B.aas=new A.a3("Cap\xedtulo III. De los Derechos Civiles \nArt\xedculo 51.",null,B.D,null,null,null,null,null,null)
B.aaz=new A.a3("Toda persona tiene el derecho de representar o dirigir peticiones ante cualquier autoridad, funcionario p\xfablico o funcionaria p\xfablica sobre los asuntos que sean de la competencia de \xe9stos o \xe9stas, y de obtener oportuna y adecuada respuesta. Quienes violen este derecho ser\xe1n sancionados o sancionadas conforme a la ley, pudiendo ser destituidos o destituidas del cargo respectivo.",null,B.E,B.l,null,null,null,null,null)
B.aan=new A.a3("T\xcdTULO IV. DEL PODER P\xdaBLICO ",null,B.D,null,null,null,null,null,null)
B.a9W=new A.a3("Cap\xedtulo I. Secci\xf3n Segunda: De la Administraci\xf3n P\xfablica \nArt\xedculo 141.",null,B.D,null,null,null,null,null,null)
B.a9N=new A.a3("La Administraci\xf3n P\xfablica est\xe1 al servicio de los ciudadanos y ciudadanas y se fundamenta en los principios de honestidad, participaci\xf3n, celeridad, eficacia, eficiencia, transparencia, rendici\xf3n de cuentas y responsabilidad en el ejercicio de la funci\xf3n p\xfablica, con sometimiento pleno a la ley y al derecho.",null,B.E,B.l,null,null,null,null,null)
B.a9k=new A.a3("2. LEY ORG\xc1NICA DE LA ADMINISTRACI\xd3N P\xdaBLICA. ",null,B.D,null,null,null,null,null,null)
B.JL=new A.cF(B.z,null,null,B.a9k,null)
B.aar=new A.a3("G.O.R.B.V N\xb0 37.305 de fecha 17 de octubre de 2001.",null,B.E,null,null,null,null,null,null)
B.JO=new A.cF(B.z,null,null,B.aar,null)
B.a9q=new A.a3("Art\xedculo 3. Objetivo de la Administraci\xf3n P\xfablica ",null,B.D,null,null,null,null,null,null)
B.a9b=new A.a3("La Administraci\xf3n P\xfablica tendr\xe1 como objetivo de su organizaci\xf3n y funcionamiento hacer efectivos los principios, valores y normas consagrados en la Constituci\xf3n de la Rep\xfablica Bolivariana de Venezuela y en especial, garantizar a todas las personas, el goce y ejercicio de los derechos humanos.",null,B.E,B.l,null,null,null,null,null)
B.a9G=new A.a3("Art\xedculo 5. Principio de la Administraci\xf3n P\xfablica al servicio de las personas ",null,B.D,null,null,null,null,null,null)
B.a9r=new A.a3("La Administraci\xf3n P\xfablica est\xe1 al servicio de las personas, y su actuaci\xf3n estar\xe1 dirigida a la atenci\xf3n de sus requerimientos y la satisfacci\xf3n de sus necesidades, brindando especial atenci\xf3n a las de car\xe1cter social.\n\nLa Administraci\xf3n P\xfablica debe asegurar a todas las personas la efectividad de sus derechos cuando se relacionen con ella.\n\nAdem\xe1s, tendr\xe1 entre sus objetivos la continua mejora de los procedimientos, servicios y prestaciones p\xfablicas, de acuerdo con las pol\xedticas que se dicten.",null,B.E,B.l,null,null,null,null,null)
B.a9l=new A.a3("Art\xedculo 6. Garant\xedas que debe ofrecer la Administraci\xf3n P\xfablica a las personas.",null,B.D,null,null,null,null,null,null)
B.a9v=new A.a3("La Administraci\xf3n P\xfablica desarrollar\xe1 su actividad y se organizar\xe1 de manera que las personas puedan:\n\n1. Resolver sus asuntos, ser auxiliadas en la redacci\xf3n formal de documentos administrativos; y recibir informaci\xf3n de su inter\xe9s por cualquier medio escrito, oral, telef\xf3nico, electr\xf3nico e inform\xe1tico;\n\n2. Presentar reclamaciones sobre el funcionamiento de la Administraci\xf3n P\xfablica;\n\n3. Acceder f\xe1cilmente a informaci\xf3n actualizada sobre el esquema de organizaci\xf3n de los \xf3rganos y entes de la Administraci\xf3n P\xfablica, as\xed como a gu\xedas informativas sobre los procedimientos administrativos, servicios y prestaciones que ellos ofrecen.",null,B.E,B.l,null,null,null,null,null)
B.a9K=new A.a3("3. LEY ORG\xc1NICA DE PROCEDIMIENTOS ADMINISTRATIVOS",null,B.D,null,null,null,null,null,null)
B.JC=new A.cF(B.z,null,null,B.a9K,null)
B.aab=new A.a3("G.O.R.V N\xba 2.818 Extraordinaria de 1\xba de julio de 1981.",null,B.E,null,null,null,null,null,null)
B.JS=new A.cF(B.z,null,null,B.aab,null)
B.a8T=new A.a3("Art\xedculo 3.",null,B.D,null,null,null,null,null,null)
B.a8V=new A.a3("Los funcionarios y dem\xe1s personas que presten servicios en la administraci\xf3n p\xfablica, est\xe1n en la obligaci\xf3n de tramitar los asuntos cuyo conocimiento les corresponda y son responsables por las faltas en que incurran. \n\nLos interesados podr\xe1n reclamar, ante el superior jer\xe1rquico inmediato, del retardo, omisi\xf3n, distorsi\xf3n o incumplimiento de cualquier procedimiento, tr\xe1mite o plazo, en que incurrieren los funcionarios responsables del asunto. \n\nEste reclamo deber\xe1 interponerse en forma escrita y razonada y ser\xe1 resuelto dentro de los quince (15) d\xedas siguientes. La reclamaci\xf3n no acarrear\xe1 la paralizaci\xf3n del procedimiento, ni obstaculizar\xe1 la posibilidad de que sean subsanadas las fallas u omisiones. Si el superior jer\xe1rquico encontrare fundado el reclamo, impondr\xe1 al infractor o infractores la sanci\xf3n prevista en el art\xedculo 100 de la presente Ley sin perjuicio de las dem\xe1s responsabilidades y sanciones a que hubiere lugar.\n\n",null,B.E,B.l,null,null,null,null,null)
B.a9i=new A.a3("4. LEY ORG\xc1NICA DE LA CONTRALOR\xcdA GENERAL DE LA REP\xdaBLICA.",null,B.D,null,null,null,null,null,null)
B.JR=new A.cF(B.z,null,null,B.a9i,null)
B.a9g=new A.a3("G.O.R.B.V N\xb0 6.013 Extraordinario del 23 de diciembre de 2010.",null,B.E,null,null,null,null,null,null)
B.JP=new A.cF(B.z,null,null,B.a9g,null)
B.a9L=new A.a3("Art\xedculo 25. Numeral 7",null,B.D,null,null,null,null,null,null)
B.aai=new A.a3("El Sistema Nacional de Control Fiscal se regir\xe1 por los siguientes principios:\n\n La participaci\xf3n de la ciudadan\xeda en la gesti\xf3n contralora.",null,B.E,B.l,null,null,null,null,null)
B.a9y=new A.a3("Cap\xedtulo VIII De la participaci\xf3n ciudadana  \nArt\xedculo 75.",null,B.D,null,null,null,null,null,null)
B.aaB=new A.a3("El Contralor o Contralora General de la Rep\xfablica, mediante resoluci\xf3n que se publicar\xe1 en la Gaceta Oficial de la Rep\xfablica Bolivariana de Venezuela, dictar\xe1 las normas destinadas a fomentar la participaci\xf3n de los ciudadanos y ciudadanas, haciendo especial \xe9nfasis en los siguientes aspectos:\n\n\u20262. Ordenar, dirigir, sistematizar y evaluar las denuncias ciudadanas que provengan de las instancias que ejercen la contralor\xeda social.",null,B.E,B.l,null,null,null,null,null)
B.a9z=new A.a3("Art\xedculo 96.",null,B.D,null,null,null,null,null,null)
B.a9u=new A.a3("Si como consecuencia del ejercicio de las funciones de control o de las potestades investigativas establecidas en esta Ley, surgieren elementos de convicci\xf3n o prueba que pudieran dar lugar a la formulaci\xf3n de reparos, a la declaratoria de responsabilidad administrativa o a la imposici\xf3n de multas, el \xf3rgano de control fiscal respectivo iniciar\xe1 el procedimiento mediante auto motivado que se notificar\xe1 a los interesados o interesadas , seg\xfan lo previsto en la Ley Org\xe1nica de Procedimientos Administrativos.",null,B.E,B.l,null,null,null,null,null)
B.aac=new A.a3("5. LEY DE INFOGOBIERNO",null,B.D,null,null,null,null,null,null)
B.JT=new A.cF(B.z,null,null,B.aac,null)
B.aav=new A.a3("G.O.R.B.V N\xba 37.313 30 de octubre de 2001 ",null,B.E,null,null,null,null,null,null)
B.JI=new A.cF(B.z,null,null,B.aav,null)
B.a9d=new A.a3("Art\xedculo 8. Numeral 8. Derecho de las personas.",null,B.D,null,null,null,null,null,null)
B.a9M=new A.a3("En las relaciones con el Poder P\xfablico y el Poder Popular, las personas tienen derecho a: \n\n \u20268. Disponer de mecanismos que permitan el ejercicio de la contralor\xeda social haciendo uso de las tecnolog\xedas de informaci\xf3n.",null,B.E,B.l,null,null,null,null,null)
B.a9c=new A.a3("Art\xedculo 14. Principio de accesibilidad.",null,B.D,null,null,null,null,null,null)
B.aa8=new A.a3("El Poder P\xfablico, en forma corresponsable con el Poder Popular, participa en el desarrollo, implementaci\xf3n y uso de las tecnolog\xedas de informaci\xf3n libres, a fin de garantizar a las personas, en igualdad de condiciones, el acceso y la apropiaci\xf3n social del conocimiento asociado a esas tecnolog\xedas.",null,B.E,B.l,null,null,null,null,null)
B.aa9=new A.a3("Art\xedculo 20. Derecho a la participaci\xf3n en la promoci\xf3n de los servicios y uso de las tecnolog\xedas de informaci\xf3n.",null,B.D,null,null,null,null,null,null)
B.a9x=new A.a3("El Poder P\xfablico y el Poder Popular est\xe1n obligados a garantizar en sus portales de internet el ejercicio del derecho de las personas a participar, colaborar y promover el uso de las tecnolog\xedas de informaci\xf3n libres, creaci\xf3n de nuevos servicios electr\xf3nicos o mejoramiento de los ya existentes.",null,B.E,B.l,null,null,null,null,null)
B.aa_=new A.a3("Art\xedculo 21. Mecanismos de ejercicio de contralor\xeda social.",null,B.D,null,null,null,null,null,null)
B.aau=new A.a3("Los servicios prestados por el Poder P\xfablico y el Poder Popular deben contener mecanismos que permitan la promoci\xf3n, desarrollo y consolidaci\xf3n de la contralor\xeda social como medio de participaci\xf3n de las personas y sus organizaciones sociales, para garantizar que la inversi\xf3n p\xfablica se realice de manera transparente y eficiente, en beneficio de los intereses de la sociedad y que las actividades del sector privado no afecten los intereses colectivos o sociales.",null,B.E,B.l,null,null,null,null,null)
B.a90=new A.a3("6. LEY DE SIMPLIFICACI\xd3N DE TR\xc1MITES ADMINISTRATIVOS.",null,B.D,null,null,null,null,null,null)
B.JM=new A.cF(B.z,null,null,B.a90,null)
B.aaj=new A.a3("G.O.R.B.V N\xb0 40.549, de fecha 26 de noviembre de 2014",null,B.E,null,null,null,null,null,null)
B.JB=new A.cF(B.z,null,null,B.aaj,null)
B.a9A=new A.a3("Art\xedculo 36.",null,B.D,null,null,null,null,null,null)
B.aae=new A.a3("Las funcionarias o funcionarios p\xfablicos, las trabajadoras y trabajadores de la Administraci\xf3n P\xfablica y, en general, quienes en cualquier situaci\xf3n de empleo p\xfablico deban prestar un servicio a las personas con ocasi\xf3n del cumplimiento de un tr\xe1mite administrativo, ser\xe1n considerados servidoras y servidores p\xfablicos a los fines del presente Decreto con Rango, Valor y Fuerza de Ley, obligados a procurar la mayor eficiencia y la m\xe1s esmerada y amable atenci\xf3n a todas aquellas personas que realizan tr\xe1mites ante la Administraci\xf3n P\xfablica, en los cuales se requiera su concurso.",null,B.E,B.l,null,null,null,null,null)
B.a9B=new A.a3("Art\xedculo 38.",null,B.D,null,null,null,null,null,null)
B.aa1=new A.a3("Los \xf3rganos y entes de la Administraci\xf3n P\xfablica, tienen el deber de ofrecer a las personas informaci\xf3n completa, oportuna y veraz en relaci\xf3n con los tr\xe1mites que se realicen ante los mismos. La Administraci\xf3n P\xfablica dar\xe1 preferencia al uso de tecnolog\xedas de informaci\xf3n, por medios de acceso remoto, a los fines de mantener informado al interesado sobre las resultas, el estado y dem\xe1s notificaciones relacionados con el tr\xe1mite de su inter\xe9s. Los \xf3rganos y entes de la Administraci\xf3n P\xfablica, deber\xe1n tener disponibles en sus sitios de Internet, v\xednculos que permitan a los interesados acceder a informaci\xf3n sobre sus tr\xe1mites. Adicionalmente, en las oficinas y establecimientos en los cuales se d\xe9 inicio a cualesquiera tr\xe1mites administrativos, la m\xe1xima autoridad de dicha oficina o establecimiento ser\xe1 responsable de la fijaci\xf3n en sitio visible al p\xfablico de los requisitos exigidos para cada tr\xe1mite, las oficinas que intervienen y su ubicaci\xf3n, la identificaci\xf3n del funcionario responsable del tr\xe1mite, su duraci\xf3n aproximada, los derechos de las personas en relaci\xf3n con el tr\xe1mite o servicio en cuesti\xf3n y la forma en que se pueden dirigir sus quejas, reclamos y sugerencias. Esta informaci\xf3n se publicar\xe1 adem\xe1s mediante gu\xedas simples de consulta p\xfablica, suministradas en forma gratuita, y deber\xe1 d\xe1rseles la publicidad necesaria a trav\xe9s de cualquier medio de comunicaci\xf3n, entre otros, visual, oral, escrito, inform\xe1tico o telem\xe1tico.",null,B.E,B.l,null,null,null,null,null)
B.aaA=new A.a3("Art\xedculo 41. Servicio de atenci\xf3n al p\xfablico. ",null,B.D,null,null,null,null,null,null)
B.a9f=new A.a3("Cada uno de los \xf3rganos y entes de la Administraci\xf3n P\xfablica deber\xe1 crear un servicio de atenci\xf3n al p\xfablico, encargado de brindar toda la orientaci\xf3n y apoyo necesario a las personas en relaci\xf3n con los tr\xe1mites que se realicen ante ellos, prestar servicios de recepci\xf3n y entrega de documentos, solicitudes y requerimientos en general, as\xed como recibir y procesar las denuncias, sugerencias y quejas que, en torno al servicio y a la actividad administrativa se formulen. Dichos servicios de atenci\xf3n al p\xfablico estar\xe1n bajo la supervisi\xf3n de la autoridad nacional unificada en materia de tr\xe1mites administrativos, la cual podr\xe1 dictar regulaciones especiales sobre su funcionamiento, de obligatorio cumplimiento para todos los \xf3rganos y entes de la Administraci\xf3n P\xfablica. Los \xf3rganos y entes de la Administraci\xf3n P\xfablica, incluso de distintos Poderes P\xfablicos o distintas entidades o unidades pol\xedtico territoriales, podr\xe1n suscribir encomiendas convenidas mediante las cuales acuerden la gesti\xf3n conjunta de varios tr\xe1mites, de manera parcial o total. En estas encomiendas convenidas podr\xe1n disponer el funcionamiento de varios organismos en una sola oficina, establecimiento, taquilla o ventanilla de atenci\xf3n, pudiendo establecer acuerdos especiales referidos al pago de determinados gastos de manera conjunta, indicando expresamente el porcentaje o la clase de gastos que corresponder\xe1 a cada \xf3rgano o ente.",null,B.E,B.l,null,null,null,null,null)
