B.a9Y=new A.a3("Art\xedculo 86. Alardeamiento o valimiento de relaciones o influencias.",null,B.D,null,null,null,null,null,null)
B.aaE=new A.a3("La persona que alardeando de valimiento o de relaciones de importancia e influencia con cualquier funcionaria p\xfablica o funcionario p\xfablico reciba o se haga prometer, para s\xed o para otro, dinero o cualquier otra utilidad, bien como est\xedmulo o recompensa de su mediaci\xf3n, bien so pretexto de remunerar el logro de favores, ser\xe1 penada o penado con prisi\xf3n de dos (2) a siete (7) a\xf1os; y con prisi\xf3n de seis (6) meses a dos (2) a\xf1os, a quien d\xe9 o prometa el dinero o cualquier otra utilidad de las que se indican en este art\xedculo, a menos que haya denunciado el hecho ante la autoridad competente antes de la iniciaci\xf3n del correspondiente proceso judicial.",null,B.E,B.l,null,null,null,null,null)
B.a95=new A.a3("Art\xedculo 89. Denuncia o acusaci\xf3n falsa",null,B.D,null,null,null,null,null,null)
B.a9T=new A.a3("Cualquiera que falsamente denunciare o acusare a otra persona de la comisi\xf3n de alguno o algunos de los hechos punibles previstos en esta Ley, ser\xe1 castigada con prisi\xf3n de uno (1) a tres (3) a\xf1os. ",null,B.E,B.l,null,null,null,null,null)
B.a9w=new A.a3("Art\xedculo 90. Promesa de soborno a funcionaria p\xfablica o funcionario p\xfablico.",null,B.D,null,null,null,null,null,null)
B.a9s=new A.a3("Quien por s\xed o por persona interpuesta prometa, ofrezca u otorgue a una funcionaria p\xfablica o funcionario p\xfablico de otro Estado, directa o indirectamente, por parte de sus nacionales, personas que tengan residencia habitual en su territorio y empresas domiciliadas en \xe9l, cualquier objeto de valor pecuniario u otros beneficios, como d\xe1divas, favores, promesas, ventajas a cambio de que dicha funcionaria o funcionario realice u omita cualquier acto, en el ejercicio de sus funciones p\xfablicas, relacionado con una transacci\xf3n de naturaleza econ\xf3mica, comercial o de cualquier otra \xedndole, ser\xe1 penada o penado con prisi\xf3n de seis (6) a doce (12) a\xf1os.",null,B.E,B.l,null,null,null,null,null)
B.a8X=new A.a3("9. C\xd3DIGO DE CONDUCTA DE LOS SERVIDORES P\xdaBLICOS.",null,B.D,null,null,null,null,null,null)
B.JH=new A.cF(B.z,null,null,B.a8X,null)
B.a9I=new A.a3("T\xcdTULO II PRINCIPIOS \xc9TICOS DEL SERVIDOR P\xdaBLICO\n\nArt\xedculo 3.",null,B.D,null,null,null,null,null,null)
B.aak=new A.a3("A los efectos de este C\xf3digo son principios rectores de los deberes y conductas de los servidores p\xfablicos respecto a los valores \xe9ticos que han de regir la funci\xf3n p\xfablica: a) La honestidad. b) La equidad. c) El decoro. d) La lealtad. e) La vocaci\xf3n de servicio. f) La disciplina. g) La eficacia. h) La responsabilidad. i) La puntualidad. j) La transparencia k) La pulcritud.",null,B.E,B.l,null,null,null,null,null)
B.aaf=new A.a3("10. C\xd3DIGO DE \xc9TICA PARA EL FUNCIONARIO P\xdaBLICO",null,B.D,null,null,null,null,null,null)
B.JD=new A.cF(B.z,null,null,B.aaf,null)
B.a9h=new A.a3("G.O.R.V N\xba 36.268 del mi\xe9rcoles 13 de agosto de 1997",null,B.E,null,null,null,null,null,null)
B.JG=new A.cF(B.z,null,null,B.a9h,null)
B.aay=new A.a3("Art\xedculo 1. Corresponde a los funcionarios p\xfablicos: ",null,B.D,null,null,null,null,null,null)
B.a9S=new A.a3("Salvaguardar en todo momento y en cada una de sus actuaciones, los intereses generales del Estado y en la preservaci\xf3n del patrimonio p\xfablico. 2. Actuar con estricto apego a las leyes y a todas las dem\xe1s normas e instrucciones que deben regir su comportamiento en la realizaci\xf3n cabal de todas las tareas que tenga asignadas. 3. Dedicar todos sus esfuerzos para cumplir, con la m\xe1xima eficiencia y la m\xe1s alta \n eficacia, la misi\xf3n que le est\xe9 encomendada. 4. Realizar permanentemente actividades de superaci\xf3n personal y de colaboraci\xf3n en el mejoramiento institucional de la administraci\xf3n p\xfablica y, en particular, del organismo donde preste sus servicios. 5. Rehusar con firmeza inequ\xedvoca el mantenimiento de relaciones o de intereses, con personas u organizaciones, que sean incompatibles con sus cargos y con las atribuciones y funciones que le est\xe9n asignadas. 6. Proceder con objetividad e imparcialidad en todas las decisiones que le corresponda tomar y en los asuntos en los que deba intervenir. 7. Rechazar en cualquier caso y circunstancia y no solicitar jam\xe1s, ni para s\xed mismos ni para terceros, pagos, beneficios o privilegios en ocasi\xf3n de los servicios que deba prestar. 8. Ajustar su conducta, de modo estricto y sin excepciones, a favor de la transparencia en la administraci\xf3n p\xfablica manteniendo la confidencialidad y reserva de informaci\xf3n en aquellos casos excepcionales cuya divulgaci\xf3n est\xe9 prohibida, por razones del superior inter\xe9s p\xfablico, de modo expreso y temporal. 9. Denunciar ante la autoridad competente y rechazar cualquier actividad contraria al correcto manejo de los fondos y del inter\xe9s p\xfablico. 10. Tratar a los ciudadanos y a los funcionarios p\xfablicos con absoluto respeto y con apego a la estricta legalidad, prest\xe1ndole sus servicios y colaboraci\xf3n de manera eficiente, puntual y pertinente, sin abusar en modo alguno de la autoridad y atribuciones que le sean conferidas en ocasi\xf3n del cargo que desempe\xf1e.",null,B.E,B.l,null,null,null,null,null)
B.a9X=new A.a3("11. DECRETO SOBRE ORGANIZACI\xd3N GENERAL \n DE LA ADMINISTRACI\xd3N P\xdaBLICA NACIONAL",null,B.D,null,null,null,null,null,null)
