B.aal=new A.a3("\u20261. Asesorar y atender a los ciudadanos, ciudadanas y comunidades organizadas que acudan a la Oficina a interponer denuncias, quejas, reclamos, sugerencias o peticiones, en relaci\xf3n a los tr\xe1mites y servicios que presta el Ministerio, en articulaci\xf3n con las unidades o dependencias administrativas u \xf3rganos p\xfablicos o entidades privadas con competencia en la materia, seg\xfan sea el caso. \u20265. Gestionar y hacer seguimiento a las atenciones dadas en esta Oficina, as\xed como emitir informaci\xf3n oportuna sobre el estado o curso de la solicitud o tr\xe1mite interpuesto y el plazo dentro del cual se dar\xe1 respuesta. \u20267. Participar en las actividades relativas a la atenci\xf3n de la ciudadan\xeda",null,B.E,B.l,null,null,null,null,null)
